import * as axios from "axios";

const baseURL='https://social-network.samuraijs.com/api/1.0/';
const instance = axios.create({
    withCredentials: true,
    headers:{"API-KEY":"e20aac34-0ed5-4a7e-872e-3bec534ebf35"}
});

export const getUsers=(currentPage,pageSize)=>{
    return instance.get(baseURL + `users?page=${currentPage}&count=${pageSize}`,).then(response=>{
        return response.data;
    })
}
export const getMe=()=>{
    return axios.get(`https://social-network.samuraijs.com/api/1.0/auth/me`,{withCredentials: true}).then(response=>{
        return response.data;
    })
}
